        <>
        <h1 id='color'><SiDatadog/></h1>
        <div id='startSlide'>
            <h1 > Fun Dog <BsHouse/> </h1>
        </div>
        <div>
            <ul>
                <li>bsb</li>
                <li>jd</li>
            </ul>
        </div>
        </>
    )
}

export default Header
